import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          hello harsha
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React<p>The following word uses a hello harsha <b>bold</b> typeface.</p>
        </a>
      </header>
      <p> this is a poc</p>

    </div>

  );
}

export default App;
